import NavBar from "./NavBar";
import SignOut from "./SignOut";
import {Text, StyleSheet} from 'react-native';
import { useNavigate } from 'react-router-dom';
import './Style.css'

function ManageInformation() {
    const navigate = useNavigate()
    const navCriminalInfo = async e => {
        navigate('/cityjail/criminal-info')
    }
    return (
        <>
        <NavBar />
        <h1>manage info page</h1>
        <div className = {styles.buttonPos}>
            <button className = "Page1" onClick={navCriminalInfo}>
                <Text style = {styles.buttonText}>Criminal Information</Text>
            </button>
            <button className = "Page2" onClick={navCriminalInfo}>
                <Text style = {styles.buttonText}>Alias Information</Text>
            </button>
            <button className = "Page3" onClick={navCriminalInfo}>
                <Text style = {styles.buttonText}>Appeal Information</Text>
            </button>
            <button className = "Page3" onClick={navCriminalInfo}>
                <Text style = {styles.buttonText}>Sentences Information</Text>
            </button>
        </div>

        <div className = {styles.buttonPos1}>
            <button className = "Page5" onClick={navCriminalInfo}>
                <Text style = {styles.buttonText}>Officers Information</Text>
            </button>
            <button className = "Page6" onClick={navCriminalInfo}>
                <Text style = {styles.buttonText}>Probation Officer Information</Text>
            </button>
            <button className = "Page5" onClick={navCriminalInfo}>
                <Text style = {styles.buttonText}>Crimes Information</Text>
            </button>
            <button className = "Page6" onClick={navCriminalInfo}>
                <Text style = {styles.buttonText}>Charges Information</Text>
            </button>
        </div>

        <SignOut />
        </>
    )
}

const styles = StyleSheet.create({
    titleText: {
      fontSize: 70,
      fontWeight: 'bold',
      color: 'white',
    },
    infoText: {
        fontSize: 50,
        fontWeight: 'bold',
        color: 'white',
      },
    authText: {
        fontSize: 35,
        fontWeight: 'normal',
        color: 'black',
        top: 30,
    },
    buttonText: {
        fontSize: 24,
        fontWeight: 'normal',
        color: 'purple',
    },
    buttonPos: {
        marginTop: 20,
        marginLeft: 10,
    },
    buttonPos1: {
        marginTop: 20,
        marginLeft: 800,
    },
    buttonPos2: {
        marginTop: 60,
        marginLeft: 10,
    },
    buttonPos3: {
        marginTop: 80,
        marginLeft: 10,
    },
    buttonPos4: {
        marginTop: 20,
        marginLeft: 30,
    },
    buttonPos5: {
        marginTop: 40,
        marginLeft: 30,
    },
    buttonPos6: {
        marginTop: 60,
        marginLeft: 30,
    },
    buttonPos7: {
        marginTop: 80,
        marginLeft: 30,
    }
  });

export default ManageInformation;
